import React, { Component } from 'react'

export default class Chat extends Component {


    logicFunction = () => {
        if (this.props.messageId === this.props.conversation.id) {
            return "Hey"
        }
    }


    render() {
        return (
            <div>
                {()=>logicFunction()}
            </div>
        )
    }
}
